(22, 'Leonardsnoni', 'qzhenjaa@yandex.kz', '89883545174', NULL, 'Последние несколько лет 3D-печать служила для строительства всего, от зданий до производств и даже транспорта. Сейчас Дубай намеревается произвести первую в мире мечеть, напечатанную на 3D-принтере. \r\nПо словам главного инженера Департамента по исламским делам и благотворительности правительства Дубая, сооружение вместит 600 верующих и будет занимать 2000 квадратных метров на двух этажах. Изготовлен будет он из бетонной смеси, строительство хотят запустить к концу года и завершить в начале 2025 года. \r\nIACAD отказался назвать организацию, ответственную за выполнение работ. \r\nДля возведений конструкций при помощи 3D-принтера нужны огромные агрегаты для печати, на которых записана информация о проекте. Выделяют строительный материал из насадки, наращивая конструкцию слоями. Абсолютное большинство конструкций, напечатанных с помощью 3D-печати, сделаны из бетона, но возможно производство и с помощью иных материй, например глина. \r\nДубай планировал стать мировой столицей 3D-печати, и в 2018 году он сделал стратегию, согласно которой к 2030 году четверть нового строительства эмирата будет напечатано на 3D-принтере. \r\nВ 2019 году он провозгласился рекордсменом мира по самой большой структуре, напечатанной на 3D-принтере, — зданию муниципалитета Дубая (высотой 9,5 метра и площадь 640 квадратных метров), а еще здесь был первый офис в мире, напечатанный на 3D-принтере, и научная лаборатория дронов, напечатанная на 3D-принтере. \r\nНо новые здания, произведенные 3D-печатью, уже появляются везде. Парки и целые аллеи, как, например, проект New Story в Табаско, который предоставит дома семьям, живущим в бедности. \r\nКомпания 3D-печати планирует стройку на поверхности Луны. Она сторонник модернизации сферы стройки при помощи таких новинок, как 3D-печать. \r\nНовость опубликовал портал <a href=https://bigrush.top>https://bigrush.top</a>', '2023-05-07 14:27:09', '2023-05-07 14:27:09'),
