(122, 'Richardwerly', 'bobrovartem255@mail.ru', '84438815869', NULL, 'Аренда автобуса на 30 человек \r\n[url=https://obltransavto.ru/transport-types/avtobus_dlja_jekskursii]Заказать автобус для экскурсии[/url] \r\nАренда автобуса на 30 человек в Москве - «Облтрансавто» \r\nПеред тем, как заказывать автобус, нужно определиться с количеством пассажиров. В компании ОблТрансАвто Вы можете взять в аренду автобус на 30 человек или больше в зависимости от корпоративных потребностей или условий заказа. \r\n \r\nОбширный парк компании позволяет выбрать автобусы вместимостью примерно на 30 человек: \r\n \r\nToyota Coaster - 29 мест; \r\nBogdan - 23-35 мест; \r\nYutong - 28 мест.; \r\nHiger - 35-49 мест. \r\nТакже мы готовы предложить Вам транспорт вместимостью и до 60 человек. \r\n \r\nМенеджеры нашей компании помогут Вам подобрать нужный транспорт в соответствии с потребностями. Например, мы готовы предложить Вам недорогие автобусы или модели класса «комфорт». \r\n \r\nКогда требуется аренда автобуса на 30 человек, Москва предлагает большое разнообразие выбора, на фоне которого выгодно отличаются условия аренды пассажирского транспорта в компании ОблТрансАвто.', '2023-05-14 16:49:50', '2023-05-14 16:49:50'),
(123, 'AldenSoill', 'igorkudryavcev479@mail.ru', '84992739728', NULL, 'Лечение алкоголизма \r\n \r\n \r\nСчитать алкоголизм вредной привычкой, от которой зависимый может избавиться самостоятельно, большая ошибка. Продолжительное употребление спиртосодержащих продуктов провоцирует хроническое заболевание с соматическими, психическими проблемами. Для устранения алкогольной зависимости требуется слаженная работа команды профильных врачей – терапевта, нарколога, психолога. Социально-реабилитационный центр помощи зависимым «Интеграция» предлагает комфортные условия лечения алкоголизма с использованием максимально результативных программ, с выявлением причин патологии. \r\n<a href=https://integration-help.ru/lechenie-depressii>Лечение депрессии</a> \r\nКак выявление причин помогает лечению алкоголизма \r\n \r\n \r\nБольшинство клиник лечения алкоголизма предлагает курс детоксикации и комплекс реабилитационных мер без учета провокатора запоя. После курса терапии пациент возвращается к привычной жизни, где снова сталкивается с негативными факторами и подвергается соблазну употребления спиртного. Не оказывает эффекта и принудительное лечение от алкоголизма – пациент не получает стимула к воздержанию и рассматривает пребывание в клинике, как временное неудобство. \r\n \r\nДля стабильного результата необходимо стимулировать запойного на отказ от спиртных напитков и устранить факторы, которые стали начальными провокаторами болезни. Отзывы о лечении алкоголизма свидетельствуют об эффективности такого подхода. \r\n \r\nРеабилитационная медицина выделяет 3 основные группы причин алкогольной зависимости: \r\n \r\nБиологическая. До 30% алкозависимых имеют наследственную предрасположенность к болезни. Зависимость формируется под влиянием психических расстройств, полученных в детском возрасте.', '2023-05-14 16:55:22', '2023-05-14 16:55:22'),
