(238, 'Carlospug', 'bajenapotapova1996@mail.ru', '83587356464', NULL, 'Типы кранов \r\n<a href=https://xn----7sbabaug7bxafzg.xn--p1ai/krany/klincy/klincy-ks-35719-5-02>Автокран Клинцы КС 35719-5-02 в аренду</a> \r\nБашенные краны подразделяются по типу платформы. Она бывает поворотной и неповоротной. Первая разновидность состоит из трех балок и цельносварной рамы. Фермы закреплены на двух. Во время работы спецтехники именно на эти элементы приходится основная нагрузка. У таких башенных кранов на платформе есть кронштейны, при помощи которых фиксируют лебедки. У башни имеется противовес, обеспечивающий устойчивость. \r\n \r\nБашенный кран данного типа используется при возведении зданий и сооружений небольшой высоты. К преимуществам использования данной спецтехники на строительной площадке относится ее мобильность, простота перемещения с места на место. \r\n \r\nУ неповоротного башенного крана присутствует один поворотный элемент, который называется оголовком. Он находится в верхней части башни. К нему присоединены стрела и противовес. Такая конструкция крана характеризуется устойчивостью. Спецтехника данного класса применяется при возведении больших по высоте строительных объектов различного назначения. \r\nМонтаж башенного крана \r\n \r\n<a href=https://xn----7sbabaug7bxafzg.xn--p1ai/krany/kb/kbm-401pa>Башенный кран КБМ-401ПА в аренду</a>', '2023-05-23 10:34:24', '2023-05-23 10:34:24'),
