(4, 'contact_map', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3630.8478911714765!2d54.369439415353895!3d24.490726666006992!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3e5e6609d0392dc3%3A0x5488ba3bf9fd695d!2sSTRAP%20STUDIOS!5e0!3m2!1sen!2sin!4v1678517449308!5m2!1sen!2sin', '2023-03-17 01:53:20', '2023-03-28 23:06:14', NULL),
